import Layout from "../components/Layout";
import { Link} from "react-router-dom";
import "./Home.css";

function Home() {
  return (
    <div className="Home">
      <Layout>

      <h1 className="flex justify-center text-center text-xl font-bold"> Bienvenue </h1>
      <h1 className="flex justify-center text-center text-xl"> Voulez-vous rejoindre </h1>
      <h1 className="flex justify-center text-center text-xl"> 
        <Link to="/yin" className="hover:text-3xl hover:font-bold pr-4">le YIN </Link> ou 
        <Link to="/yang" className="hover:text-3xl hover:font-bold pl-4"> le YANG</Link> </h1>

      </Layout>
    </div>
  );
}

export default Home;
